const Category = (category) => {
  const { title } = category;
  return (
    <div
      className="category-container"
      style={{ backgroundImage: `url(${category.imageUrl})` }}
    >
      {/*  <img />*/}
      <div className="category-body-container">
        <h2>{title}</h2>
        <p>Shop Now</p>
      </div>
    </div>
  );
};

export default Category;
